INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "お！\nあそこに困ってそうな人発見！", 0, 0, 1001, 1.4, 0, 1, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 2, "春咲 ひより", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "大切な人を\n守れるようになりたい…って", 0, 0, 1002, 1.4, 0, 1, 1, "みんなみたいに\nわたしも強くならなきゃ", 2, "草野 優衣", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "少しは磨かれると思いますよ。", "キミに必要な集中力と感性が", 0, 0, 1003, 1.4, 0, 1, 1, "フェンシングを始めてみては？", 2, "士条 怜", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "みそぎはねぇ、\nかくれんぼやりたい！", "今日はなにして遊ぶ？", 0, 0, 1004, 1.5, 0, 1, 1, "ねぇ、にいちゃん！", 2, "穂高 みそぎ", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "私といっしょに…\nいかない？", "ねぇ…", 0, 0, 1006, 1.4, 0, 1, 1, "風宮あかりです", 2, "風宮 あかり", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "食べ物の恨みは怖いのー", "プリンたべたいのー", 0, 0, 1007, 1.5, 0, 1, 1, "出雲宮子なのー", 2, "出雲 宮子", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "いいよ。\n見られることは運命さ…", "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 0, 1008, 1.4, 0, 1, 1, "ボクは虹村雪。", 2, "虹村 雪", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "人呼んで「疾風の冥姫」!!", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 0, 1009, 1.4, 0, 1, 1, "フッ…聞いて後悔するがいい！", 2, "柊杏奈", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "ほんまおおきにやわ～♪", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 0, 1010, 1.5, 0, 1, 1, "マホマホ王国のプリンセス、\nまほ姫どす", 2, "姫宮 真歩", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "ここで会ったが\n100年目～！", "生き別れたお兄ちゃんを探して\n三千世界！", 0, 0, 1011, 1.4, 0, 1, 1, "衣之咲璃乃です！", 2, "衣之咲 璃乃", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "…って、お願い！\n誰にも言わないでおいて～！", "ち、超能力って…\n何のことかな～？", 0, 0, 1012, 1.4, 0, 1, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 2, "柏崎 初音", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "一応カリスマ読モJKやってまっす！", 0, 0, 1016, 1.4, 0, 1, 1, "ちょす！\n美波鈴奈だよ～♪", 2, "美波 鈴奈", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "でも、沖縄もとってもいいとこさー", "東京は遊園地みたいなところさー", 0, 0, 1017, 1.4, 0, 1, 1, "はいたーい。\n喜屋武香織さー。", 2, "喜屋武 香織", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "イオちゃんって呼んでね。", "先生って呼ばれるのは\nくすぐったいから", 0, 0, 1018, 1.4, 0, 1, 1, "支倉伊緒です。", 2, "支倉 伊緒", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "ミミをおいてかないでぇ～", "あ！/\お兄ちゃ～ん\nまってよ～", 0, 0, 1020, 1.5, 0, 1, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 2, "茜 ミミ", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "ふぇぇぇぇぇん……", "あの……\nふぇ……", 0, 0, 1021, 1.5, 0, 1, 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 2, "栗林 くるみ", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "なんてありがとうございます！", "こんな私に貴重な時間を\n割いていただき、", 0, 0, 1022, 1.4, 0, 1, 1, "風宮よりです。\nあああああ！", 2, "風宮 より", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "私こっち行きたいー\nね、早く早くー", "おにいちゃんどこいくの？\nえ？", 0, 0, 1023, 1.5, 0, 1, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 2, "北条 綾音", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "これて何か違う…\nあああすみません！", "ふ、不束者ですが\nどうぞ末永く…って、", 0, 0, 1025, 1.4, 0, 1, 1, "わっ…わっ…私、\n天野すずめといいます！", 2, "天野 すずめ", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "離しませんわ………\n絶対に…!!", "あなたは…運命の……\n伴侶……", 0, 0, 1027, 1.4, 0, 1, 1, "……クスクス…私は\n…倉石恵理子……", 2, "倉石 恵理子", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "…そうでしょ？？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 0, 1028, 1.4, 0, 1, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 2, "佐々木 咲恋", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "あはは、\n私もまだまだだなぁ～", "ぇっと…\nキミ、私のこと知らないの?!", 0, 0, 1029, 1.4, 0, 1, 1, "桜井望だよ！\nよろしくねっ", 2, "桜井 望", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "ショーグン、\nワタシと一緒に天下統一デース！", "初めまして、\n私はニノン・ジュベール申すデス！", 0, 0, 1030, 1.4, 0, 1, 1, "デケデケデンっ！", 2, "ニノン・ジュベール", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "おかしいですね……", "でもって私の隣にいるのが……\nえ、見えない？", 0, 0, 1031, 1.4, 0, 1, 1, "上喜しのぶです。\n手元のドクロが父です。", 2, "上喜 しのぶ", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "そう、\nオラのボケに突っ込める相方が…！", "けんども\nそれには足りないモンが…", 0, 0, 1033, 1.5, 0, 1, 1, "目指すはビッグな\nお笑い芸人だっぺ！", 2, "野戸まひる", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "ちょ\nちょっと一杯飲んできます…！", "ちょっと緊張しちゃって…", 0, 0, 1034, 1.4, 0, 1, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 2, "綾瀬 ゆかり", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "これ以上お話しすることは…\nないです！", "知らない人とは話しちゃいけないので", 0, 0, 1036, 1.5, 0, 1, 1, "氷川鏡華…です", 2, "氷川 鏡華", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "……あ、アラーム。", 0, 0, 1038, 1.4, 0, 1, 1, "柏崎…栞です。", 2, "柏崎 栞", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "野に咲く花が、\n唯一の話相手です。", "私、一人も友達がいなくて……", 0, 0, 1040, 1.4, 0, 1, 1, "ふ、双葉碧です。", 2, "双葉 碧", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "そう思っています。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 0, 1042, 1.4, 0, 1, 1, "三角千歌です。", 2, "三角 千歌", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "う、疑ってすまなかったな…", "あぁ？\nお前のそいつの仲間か？", 0, 0, 1043, 1.4, 0, 1, 1, "安芸真琴だ。", 2, "安芸 真琴", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "生けとし生ける全ての者よ！", 0, 0, 1044, 1.4, 0, 1, 1, "わらわこそは夜を総べる者！", 2, "イリヤ・オーンスタイン", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "ｌク、クウカに何かご用ですか!?", "ぐふふふふ……はっ！", 0, 0, 1045, 1.4, 0, 1, 1, "そこで騎士は妖精を乱暴に……", 2, "遠見 空花", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "う～ん…\n猫ってホントに最高にゃ～♪", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 0, 1046, 1.4, 0, 1, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 2, "宮坂たまき", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "それでは早速クエストに…", 0, 0, 1048, 1.4, 0, 1, 1, "大神美冬よ！", 2, "大神 美冬", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "クエストもバトルも\n掃除も洗濯も", 0, 0, 1049, 1.4, 0, 1, 1, "星野静流だよ！", 2, "星野静流", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "見ての通りの\nセクシー美少女で", 0, 0, 1050, 1.5, 0, 1, 1, "アタシは玉泉美咲。", 2, "玉泉美咲", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "？？？？", "？？？？", 0, 0, 1052, 1.4, 0, 1, 1, "？？？", 2, "リマ", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 0, 0, 1053, 1.5, 0, 1, 1, "モニカ・ヴァイスヴィントだ。", 2, "モニカ・ヴァイスヴィント", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 0, 0, 1058, 1.5, 0, 1, 1, "モニカ・ヴァイスヴィントだ。", 2, "ペコリーヌ", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 0, 0, 1059, 1.5, 0, 1, 1, "モニカ・ヴァイスヴィントだ。", 2, "コッコロ", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES (0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 0, 0, 1060, 1.5, 0, 1, 1, "モニカ・ヴァイスヴィントだ。", 2, "キャル", 1, 0);
